import React from 'react';
// import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="grid">          
            <nav class="navbar" id="navbarAdmin">              
              <a href="#">HOME</a>         
              <a href="#">SIGN UP</a>            
              <a href="#">LOGIN</a>
              <a href="https://www.youtube.com/watch?v=XfRY0ASZHuU">YOUR ACCOUNT</a>

            </nav>        
        </div>        
        <p>
          <p>
          <code><h1  style={{color: 'white'}}>Searchcury</h1></code>
          <br></br>
          <p>you can search a movie that interest you by click the the link below</p>
          <p>Or if not have an account please sign up and login into your account</p>
        </p>
        </p>  

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          {/* Learn React */}
          Search for mivies
        </a>
      </header>
    </div>
  );
}

export default App;
